﻿using NUnit.Framework;
using UnityEngine;
using UnityEngine.TestTools.Utils;

public static class CustomAssert
{
    public static void AreEqual(Color expected, Color actual, string message)
    {
        Assert.That(actual, Is.EqualTo(expected).Using(ColorEqualityComparer.Instance), message);
    }
    public static void AreNotEqual(Color expected, Color actual, string message)
    {
        Assert.That(actual, Is.Not.EqualTo(expected).Using(ColorEqualityComparer.Instance), message);
    }
    public static void AreEqual(Vector2 expected, Vector2 actual, string message)
    {
        Assert.That(actual, Is.EqualTo(expected).Using(Vector2EqualityComparer.Instance), message);
    }
    public static void AreEqual(Vector3 expected, Vector3 actual, string message)
    {
        Assert.That(actual, Is.EqualTo(expected).Using(Vector3EqualityComparer.Instance), message);
    }
    public static void AreEqual(Quaternion expected, Quaternion actual, string message)
    {
        Assert.That(actual, Is.EqualTo(expected).Using(QuaternionEqualityComparer.Instance), message);
    }
}

﻿using System.Collections.Generic;
using System.Linq;
using UnityEngine;
using UnityEngine.SceneManagement;

public static class Extensions
{
    public static IEnumerable<GameObject> GetPrefabInstances(this Scene scene, GameObject prefab)
    {
        return scene.GetRootGameObjects()
            .SelectMany(obj => obj.GetComponentsInChildren<Transform>())
            .Select(t => t.gameObject)
            .Where(obj => obj.name.StartsWith(prefab.name));
    }
    public static IEnumerable<GameObject> GetObjectsByName(this Scene scene, string name)
    {
        return scene.GetRootGameObjects()
            .SelectMany(obj => obj.GetComponentsInChildren<Transform>())
            .Select(t => t.gameObject)
            .Where(obj => obj.name == name);
    }
}

﻿using NUnit.Framework;
using System.Collections.Generic;
using System.Linq;
using System.Reflection;
using UnityEngine;

namespace Tests
{
    public class FieldBridge<T>
    {
        public T value
        {
            get
            {
                (Component component, FieldInfo field) = fieldInfos.First();
                return (T)field.GetValue(component);
            }
            set
            {
                (Component component, FieldInfo field) = fieldInfos.First();
                field.SetValue(component, value);
            }
        }
        private readonly (Component, FieldInfo)[] fieldInfos;
        public FieldBridge(GameObject obj, string name)
        {
            fieldInfos = FindFields(obj, name).ToArray();
            Assert.AreEqual(1, fieldInfos.Length, $"There must be exactly 1 field with the name of '{name}' in GameObject '{obj}'!");
        }
        private IEnumerable<(Component, FieldInfo)> FindFields(GameObject obj, string name)
        {
            foreach (Component component in obj.GetComponents<Component>())
            {
                IEnumerable<FieldInfo> fields = component
                    .GetType()
                    .GetFields(BindingFlags.Instance | BindingFlags.Public | BindingFlags.NonPublic)
                    .Where(f => f.Name == name);
                foreach (FieldInfo field in fields)
                {
                    yield return (component, field);
                }
            }
        }
    }
}

﻿using NUnit.Framework;
using UnityEngine;

namespace Tests
{
    public abstract class GameObjectBridge
    {
        public Vector3 position
        {
            get => transform.position;
            set => transform.position = value;
        }
        public Vector3 scale
        {
            get => transform.localScale;
            set => transform.localScale = value;
        }
        public Transform transform
        {
            get;
            private set;
        }
        public readonly GameObject gameObject;
        public GameObjectBridge(GameObject gameObject)
        {
            this.gameObject = gameObject;
            transform = FindComponent<Transform>();
        }

        protected FieldBridge<T> FindField<T>(string name)
        {
            return new FieldBridge<T>(gameObject, name);
        }
        protected MethodBridge<T> FindMethod<T>(string name, int parameterCount, string returnType)
        {
            return new MethodBridge<T>(gameObject, name, parameterCount, returnType);
        }
        protected T FindComponent<T>() where T : Component
        {
            T[] components = gameObject.GetComponents<T>();
            Assert.AreEqual(1, components.Length, $"There must be exactly 1 component of type of type '{typeof(T)}' in GameObject '{gameObject}'!");
            return components[0];
        }
        protected T FindComponentInChildren<T>() where T : Component
        {
            T[] components = gameObject.GetComponentsInChildren<T>();
            Assert.AreEqual(1, components.Length, $"There must be exactly 1 component of type of type '{typeof(T)}' in GameObject '{gameObject}' (or its children)!");
            return components[0];
        }
    }
}

﻿using System;
using UnityEngine.InputSystem;
using UnityEngine.InputSystem.Controls;

public class InputPress : IDisposable
{
    private readonly InputTestFixture input = new InputTestFixture();
    private readonly ButtonControl[] controls;
    public InputPress(params ButtonControl[] controls)
    {
        this.controls = controls;
        foreach (ButtonControl control in controls)
        {
            input.Press(control);
        }
        InputSystem.Update();
    }
    public void Dispose()
    {
        foreach (ButtonControl control in controls)
        {
            input.Release(control);
        }
        InputSystem.Update();
    }
}

﻿using NUnit.Framework;
using System.Collections.Generic;
using System.Linq;
using System.Reflection;
using UnityEngine;

namespace Tests
{
    public class MethodBridge<T>
    {
        public T Invoke(params object[] args)
        {
            try
            {
                (Component component, MethodInfo method) = methodInfos.First();
                return (T)method.Invoke(component, args);
            }
            catch (TargetInvocationException e)
            {
                throw e.InnerException;
            }
        }
        private readonly (Component, MethodInfo)[] methodInfos;
        public MethodBridge(GameObject obj, string name, int parameterCount, string returnType)
        {
            methodInfos = FindMethods(obj, name).ToArray();
            Assert.AreEqual(1, methodInfos.Length, $"There must be exactly 1 method with the name of '{name}' in GameObject '{obj}'!");
            (Component _, MethodInfo method) = methodInfos.First();
            Assert.AreEqual(parameterCount, method.GetParameters().Length, $"The method '{name}' in GameObject '{obj}' must have exactly {parameterCount} parameters!");
            Assert.AreEqual(typeof(T), method.ReturnType, $"The method '{name}' in GameObject '{obj}' must have a return type of '{returnType}'!");
        }
        private IEnumerable<(Component, MethodInfo)> FindMethods(GameObject obj, string name)
        {
            foreach (Component component in obj.GetComponents<Component>())
            {
                IEnumerable<MethodInfo> fields = component
                    .GetType()
                    .GetMethods(BindingFlags.Instance | BindingFlags.Public | BindingFlags.NonPublic)
                    .Where(f => f.Name == name);
                foreach (MethodInfo field in fields)
                {
                    yield return (component, field);
                }
            }
        }
    }
}

