﻿using NUnit.Framework;
using System.Collections;
using System.Collections.Generic;
using System.IO;
using System.Linq;
using UnityEditor;
using UnityEngine;
using UnityEngine.SceneManagement;
using UnityEngine.TestTools;

namespace Tests
{
    public class TestSuite
    {
        protected Scene currentScene => loadedScene.IsValid()
            ? loadedScene
            : testScene;
        private Scene testScene;
        [UnitySetUp]
        public IEnumerator UnitySetUp()
        {
            yield return null;
            testScene = SceneManager.GetActiveScene();
        }

        [UnityTearDown]
        public IEnumerator UnityTearDown()
        {
            while (loadedObjects.Count > 0)
            {
                GameObject obj = loadedObjects.Dequeue();
                if (obj)
                {
                    Object.Destroy(obj);
                    yield return null;
                }
            }

            for (GameObject obj = FindObjectToDestroy(); obj; obj = FindObjectToDestroy())
            {
                Object.Destroy(obj);
                yield return null;
            }

            if (loadedScene.IsValid())
            {
                AsyncOperation operation = SceneManager.UnloadSceneAsync(loadedScene);
                yield return new WaitUntil(() => operation == null || operation.isDone);
                loadedScene = default;
            }
        }

        private GameObject FindObjectToDestroy()
        {
            return SceneManager.GetActiveScene().GetRootGameObjects().Skip(1).FirstOrDefault();
        }

        private Scene loadedScene;
        protected IEnumerator LoadTestScene(string name)
        {
            AsyncOperation async = SceneManager.LoadSceneAsync(name, LoadSceneMode.Additive);
            yield return async;
            loadedScene = SceneManager.GetSceneByName(name);
            Assert.IsTrue(loadedScene.IsValid(), $"Scene {name} could not be loaded, help!");
            yield return new WaitForFixedUpdate();
        }
        protected T LoadAsset<T>(string path) where T : Object
        {
            FileAssert.Exists(new FileInfo(path));
            T asset = AssetDatabase.LoadAssetAtPath<T>(path);
            Assert.IsNotNull(asset, $"Could not load asset of type {typeof(T).Name} at path {path}!");
            return asset;
        }

        protected readonly Queue<GameObject> loadedObjects = new Queue<GameObject>();
        protected GameObject InstantiateGameObject(GameObject prefab, Vector3 position, Quaternion rotation)
        {
            GameObject instance = Object.Instantiate(prefab, position, rotation);
            loadedObjects.Enqueue(instance);
            return instance;
        }
    }
}

﻿using NUnit.Framework;
using System;
using System.IO;
using UnityEditor;
using UnityEngine;

namespace Tests
{
    public class TestUtils
    {
        private const float EPSILON = 0.000001f;
        public static bool Approximately(float a, float b, float threshold = EPSILON)
        {
            if (threshold > 0f)
            {
                return Mathf.Abs(a - b) <= threshold;
            }
            else
            {
                return Mathf.Approximately(a, b);
            }
        }
        public static bool Approximately(Vector2 one, Vector2 two, float threshold = EPSILON)
        {
            return Approximately(one.x, two.x, threshold)
                && Approximately(one.y, two.y, threshold);
        }
        public static bool Approximately(Vector3 one, Vector3 two, float threshold = EPSILON)
        {
            return Approximately(one.x, two.x, threshold)
                && Approximately(one.y, two.y, threshold)
                && Approximately(one.z, two.z, threshold);
        }
        public static bool Approximately(Bounds one, Bounds two, float threshold = EPSILON)
        {
            return Approximately(one.center, two.center, threshold)
                && Approximately(one.size, two.size, threshold);
        }
        public static string RunGitCommand(string projectPath, string gitCommand)
        {
            // Set up our processInfo to run the git command and log to output and errorOutput.
            System.Diagnostics.ProcessStartInfo processInfo = new System.Diagnostics.ProcessStartInfo("git", @gitCommand)
            {
                WorkingDirectory = projectPath,
                CreateNoWindow = true,          // We want no visible pop-ups
                UseShellExecute = false,        // Allows us to redirect input, output and error streams
                RedirectStandardOutput = true,  // Allows us to read the output stream
                RedirectStandardError = true    // Allows us to read the error stream
            };

            // Set up the Process
            System.Diagnostics.Process process = new System.Diagnostics.Process
            {
                StartInfo = processInfo
            };

            try
            {
                process.Start();  // Try to start it, catching any exceptions if it fails
            }
            catch (Exception e)
            {
                // For now just assume its failed cause it can't find git.
                Debug.LogError("Git is not set-up correctly, required to be on PATH, and to be a git project.");
                throw e;
            }

            // Strings that will catch the output from our process.
            // Read the results back from the process so we can get the output and check for errors
            string output = process.StandardOutput.ReadToEnd();
            string errorOutput = process.StandardError.ReadToEnd();

            process.WaitForExit();  // Make sure we wait till the process has fully finished.
            process.Close();        // Close the process ensuring it frees it resources.

            // Log any errors.
            if (errorOutput != "")
            {
                Debug.LogError("Git Error: " + errorOutput);
            }

            return output;  // Return the output from git.
        }

        public static GameObject LoadPrefab(string path)
        {

            FileInfo file = new FileInfo(path);
            FileAssert.Exists(file);
            GameObject obj = AssetDatabase.LoadAssetAtPath<GameObject>(path);
            Assert.NotNull(obj, $"Prefab '{path}' is empty?");
            return obj;
        }
    }
}

﻿using UnityEngine;
using UnityEngine.InputSystem;

public class InputTest : MonoBehaviour
{
    public float movementSpeed = 5;
    private void Start()
    {

    }

    private void FixedUpdate()
    {
        var direction = Vector3.zero;
        if (Keyboard.current.upArrowKey.isPressed)
        {
            direction += Vector3.up;
        }
        if (Keyboard.current.downArrowKey.isPressed)
        {
            direction += Vector3.down;
        }
        if (Keyboard.current.leftArrowKey.isPressed)
        {
            direction += Vector3.left;
        }
        if (Keyboard.current.rightArrowKey.isPressed)
        {
            direction += Vector3.right;
        }
        if (direction != Vector3.zero)
        {
            transform.position += direction.normalized * movementSpeed * Time.deltaTime;
        }
    }
}

